import React from 'react';

const UserCard = ({ user, onLike, onDislike }) => {
  return (
    <div className="card" style={{ width: '18rem' }}>
      <img src={user.profileImageUrl} className="card-img-top" alt={`Profile of ${user.name}`} />
      <div className="card-body">
        <h5 className="card-title">{user.name}</h5>
        <p className="card-text">{user.bio}</p>
        <button onClick={onLike} className="btn btn-success mr-2">
          Like
        </button>
        <button onClick={onDislike} className="btn btn-danger">
          Dislike
        </button>
      </div>
    </div>
  );
};

export default UserCard;
